import React, { useEffect } from "react";
import "../../styles/Register.css"; // Make sure to create a new Register.css
import { Container, Card } from "react-bootstrap";

function Register() {
  useEffect(() => {
    // Add the class when the component is mounted
    document.body.classList.add('register-page');
    
    // Clean up the class when the component is unmounted
    return () => {
      document.body.classList.remove('register-page');
    };
  }, []);

  return (
    <Container className="d-flex justify-content-center align-items-center min-vh-100">
      <Card className="register-card shadow-lg p-4">
        <h2 className="text-center mb-4">Register</h2>
        <form className="register-form">
          <>
          <input type="text" placeholder="First Name" className="form-control mb-3" />
          <input type="email" placeholder="Email" className="form-control mb-3" />
          </>
          <input type="password" placeholder="Password" className="form-control mb-3" />
          <input type="password" placeholder="Confirm Password" className="form-control mb-3" />
          <button type="submit" className="btn btn-primary w-100">Register</button>
        </form>
        <div className="login-link mt-3 text-center">
          <p>Already have an account? <a href="/login">Login</a></p>
        </div>
      </Card>
    </Container>
  );
}

export default Register;
